import Link from 'next/link';

export default function Contact() {
    return (
        <div>
            <h1>Contact Me:</h1>
            <h3>Phone:</h3>
            <p>+264 81 441 6011</p>
            <h3>Email:</h3>
            <p>caraspall389@gmail.com</p>
            <Link href="/index">
                <a>Home</a>
            </Link>
            <style jsx>
                {`
                div {
                    background-color: azure;
                    border: solid;
                    text-align: center;
                }
                `}
            </style>
        </div>
    );
}
